VALUES ('3270160079209', '2 Pâtes Feuilletées Pur Beurre, Sachet De 500 Grammes', 'OCCONGÉLA • Au réfrigérateur : TO heures Sortez un bioc de pâte feu\'iletee de son emballage et placez-le dans son film plastique 10 heures au réfrçérateur. Laissez reposer quelques minutes à température ambiante (200C) avant cuisson. CUISSON APRÈS DÉCONGÉLATION : • Au four : \'«près décongélation, enlevez le sachet plastique. Farinez la pâte ainsi que votre plan de travail. Etalez doucement la pâte à raide d\'un rouleau. puis déposez-la dans votre moule (diamètre maximum 25 cm) Pressez le fond et les bords. Piquez le fond avec une fourchette. Garnissez et cuisez selon voùse recette. une cuisson à blanc . COUTez le fond de légumes secs, préchauffez votre four à 21 OOC (th. 7) et latssez 20 et 25 minutes selon la coloration de la pâte• Oates feuilletées peuvent être utilisées pour tous types de préparations salées ou sucrées,', 'https://static.openfoodfacts.org/images/products/327/016/007/9209/front.6.400.jpg', '23.7', '16.4', '35.1', '1.6', '1.7', '5.6', '0.88', '0.346456692913386', '', '1');

